var i = 0
for(let key in countrycode){
    var rank = 0
    for(let j = 0; j<199; j+=1){
        if(visa[i][j] == 2){
            rank += 1
        }
        else if(visa[i][j] == 1 || visa[i][j] > 2){
            rank += 2
        }
    }
    countrycode[key].push(rank)
    countrycode[key].push([i,i-1])
    i += 1
}
